    false,nt"url": null,nt"notes": "This is the Habitat Monitoring and Inventory
    Plan for Malheur National Wildlife Refuge. The goal of this plan is to develop an
    annual procedure to determine the success of management strategies in meeting the
    habitat needs of wildlife.  The habitat management program at Malheur National Wildlife
    Refuge employs a variety of different treatment strategies to provide optimum habitat
    conditions for seven key wildlife species along with a variety of associated species.
     Idle, hay only (HO), rake/bunch/graze (RBG), graze only (GO), prescribed burning
    (PB), herbicide use, and water management are all strategies that are currently
    applied to manipulate vegetation to achieve habitat objectives in uplands, meadows,
    marshes and riparian zones.  This plan is necessary in order to select the level
    and types of treatment strategy needed to achieve established habitat objectives
    and to monitor the success of the habitat management program.",nt"license_title":
